Frankrijk / Verenigde Staten / Spanje / Verenigd Koninkrijk
Oorlog / Thriller
115 minuten

goed

met Matt Damon, Greg Kinnear en Brendan Gleeson

Enkele Amerikaanse militairen onder leiding van Roy Miller (Matt Damon) gaan in de Iraakse woestijn op zoek naar 
massavernietigingswapens nadat een CIA-agent hem een intrige onthult. Terwijl ze van het ene gevaar in het andere tuimelen, komt 
er heel wat geheime informatie aan het licht over de totstandkoming van de oorlog. Miller bekijkt de situatie nu vanuit een 
ander oogpunt en beseft dat het doel van de missie op de helling staat.
